import React from 'react'

const MapMarker = ({text, handleClick, isMain}) => {
    let style = isMain ? {
                  color: 'white',
                  background: 'grey',
                  padding: '5px 3px',
                  display: 'inline-flex',
                  textAlign: 'center',
                  alignItems: 'center',
                  justifyContent: 'center',
                  borderRadius: '10%'
                } :
                {
                  background: 'red',
                  display: 'inline-flex',
                  alignItems: 'center',
                  justifyContent: 'center',
                  borderRadius: '100%',
                  height: '10px'
                }
    return (
      <div style={style}
            onClick={handleClick}>
      {isMain ? text : ''}
      </div>
    )
}

export default MapMarker
